import React from 'react'
import {AppBar, Toolbar, IconButton, Typography, Button} from '@material-ui/core';
import {Menu} from '@material-ui/icons'

function Topbar(){
    return (
        <div>
            <AppBar position='sticky'>
                <Toolbar>
                    <IconButton>
                        <Menu/>
                    </IconButton>
                    <Typography style ={{flexGrow : 1}} >
                        SimplyScheduler
                    </Typography>
                    <Button>Login</Button>
                </Toolbar>
            </AppBar>
        </div>
    );
}

export default Topbar;
